import s from './Item.module.css'
import {NavLink} from "react-router-dom";

const Item = ({imageUrl, count, name, size, weight}) => {

    return (
        <div>
            <div>
                 <table className={s.item}>
                        <tr>
                            <td><img src={imageUrl}/>
                            </td>
                            <td valign="top">
                                name: {name}
                                <br/>
                                description: {weight + '' + size.height + '' + size.height}
                                <br/>
                                count: {count}
                                <br/>
                                <NavLink to='/additionalInformation'>Additional information</NavLink>
                            </td>
                        </tr>
                    </table>

            </div>
        </div>
    )

}


export default Item
